function calculate(){

	var subject= document.getElementById("subject").value;
    var num= document.getElementById("courseNum").value;
    var sub_num= subject.concat(num);
    var results= document.getElementById("results");
    var selected_year = document.getElementById("year").value;
    var html = "";
    results.innerHTML = "";
    var count = 0;
    var render_array = [];

	if (groups[sub_num] ==null){
    	html = "<p>No data found given specified input</p>";
    	results.innerHTML = html;
    	return;

	}
    else {

    	console.log(groups[sub_num].length);
    	var arraylength= groups[sub_num].length;

    	for (var i=0; i<arraylength; i++){

    		var year = groups[sub_num][i].TERM_DESC.split(" ").pop();

    		if (year == selected_year) {
				var container = "myChart".concat(i);

                html += '<div style=""><canvas id=' + container + ' width="400" height="400"></canvas></div><br>';
				
				render_array.push(i);

    			count += 1;
    		}
    		
    	}
        console.log(html);
        results.innerHTML = html;

    }

    if (count == 0) {
    	html = "<p>No results found given specified inputs</p>";
    	results.innerHTML = html;
        return;
    }

    for (var j=0; j<render_array.length; j++){
        var ctx = document.getElementById("myChart".concat(render_array[j]));
        var a = groups[sub_num][render_array[j]]['aprec'];
        var b = groups[sub_num][render_array[j]]['bprec'];
        var c = groups[sub_num][render_array[j]]['cprec'];
        var d = groups[sub_num][render_array[j]]['dprec'];
        var f = groups[sub_num][render_array[j]]['fprec'];
        var inst = groups[sub_num][render_array[j]]['instructor'].concat(" ").concat(groups[sub_num][render_array[j]]['TERM_DESC']);
        // alert(a);
        var myChart = new Chart(ctx, {
            type: 'bar',
            data: {
                labels: ["A", "B", "C", "D", "F"],
                datasets: [{
                    label: '% of Grades Given',
                    data: [a, b, c, d, f],
                    backgroundColor: [
                        'rgba(159,204,59,0.9)',
                        'rgba(159,204,59, 0.9)',
                        'rgba(159,204,59, 0.9)',
                        'rgba(159,204,59, 0.9)',
                        'rgba(159,204,59, 0.9)'
                    ],
                    borderColor: [
                        'rgba(159,204,59,1)',
                        'rgba(159,204,59, 1)',
                        'rgba(159,204,59, 1)',
                        'rgba(159,204,59, 1)',
                        'rgba(159,204,59, 1)'
                    ],
                    borderWidth: 1
                }]
            },
            options: {
                legend: {
                    display: true,
                    position: 'bottom'
                },
                title: {
                    display: true,
                    text: inst
                },
                scales: {
                    yAxes: [{
                        ticks: {
                            beginAtZero:true
                        }
                    }]
                }
            }
        });
    }

}

 